import React, { useEffect } from 'react';
import { Switch, Route } from "react-router-dom"
import Navbar from "./components/Header"
import Search from "./components/pages/Search"
import Cards from "./components/Cards"
import SelectedCard from "./components/SelectedCard"
import { Container, Col, Row } from "reactstrap";
import axios from "axios";

import Mapbox from "./components/Mapbox"
// Latitudes range from -90 to 90, and longitudes range from -180 to 80 42.00000 (5 decimal places)

function App() {
  useEffect(() => {
  axios.post("https://api.random.org/json-rpc/2/invoke", {
    jsonrpc: "2.0",
    method: "generateIntegerSequences",
    params: {
      apiKey: "f47e402c-ba3e-4ca9-8842-55e557335be7",
      n: 1,
      length: 4,
      min: -180,
      max: 90,
      replacement: true,
      base: 10
    },
    id: 28572
  }).then(res => res.data.result.random.data).then(data => console.log(data))
  },[])

  return (
    <Container fluid={true}>
      <Row>
        <Col>
          <Navbar />

        </Col>
      </Row>
      <Row>
        <Col>
          <Mapbox />
        </Col>
        <Col>
          <Cards className="border" />
        </Col>
      </Row>
      <Row>
        <Col>
        {/* <SelectedCard /> */}
        </Col>
      </Row>
    </Container>

  );
}

export default App;
